const bebas = `
font-family: bebas-neue-by-fontfabric, sans-serif;
font-style: normal;
`;

const bebasRegular = `
${bebas}
font-weight: 400;
`;

const bebasBook = `
${bebas}
font-weight: 300;
`;

const bebasBold = `
${bebas}
font-weight: 700;
`;


const FONTS = {
    bebasRegular,
    bebasBook,
    bebasBold,
};

export default FONTS;
